import React from 'react';
import UsersList from './components/UsersList';

const Users = () => {
  const USERS = [
    {
      id: '1',
      image: 'https://picsum.photos/200/300',
      name: 'John Doe',
      placeCount: 3,
    },
    {
      id: '2',
      image: 'https://picsum.photos/200/300',
      name: 'John Doe',
      placeCount: 4,
    },
  ];

  return <UsersList items={USERS} />;
};

export default Users;
